/* global google */
import React, {useState} from 'react';
import './map.css';
import { Link } from 'react-router-dom';

import { usePosition } from 'use-position';

import {
    GoogleMap,
    withScriptjs,
    withGoogleMap,
    Marker,
    InfoWindow,
    GroundOverlay
} from 'react-google-maps';

import GameIcon from './assets/game-icon.svg'; import CharIcon from './assets/header-char-icon.svg';
import QuizIncomplete from './assets/quiz-icon.svg'; import QuizComplete from './assets/quiz-complete.svg';
import FactIncomplete from './assets/fact-icon.svg'; import FactComplete from './assets/fact-complete.svg';
import PicIncomplete from './assets/picture-incomplete.svg'; import PicComplete from './assets/picture-complete.svg';

import HeaderBackdrop from './assets/header-background.svg';
import MapOverlay from './assets/main-building.svg';
import ProfilePic from "../../screens/gameMenu/assets/user-icon.svg";
import SettingsIcon from "../../screens/gameMenu/assets/settings-icon.svg";

// Impromptu JSON data for locations
export const Interaction = {
    locations: {
        Quiz: [
            {
                id: 1,
                coordinates: [51.523176, -2.578209],
                description: "Test Me!",
                complete: false,
            },
            {
